import React from "react";
import "../../index.css";

const ButtonFooter = ({ title,onClick,filter,expectFilter}) => {
    return (
        <button
            className={filter === expectFilter ? "selectedButton" : "footerButton"}
            onClick={onClick}
        >
            {title}
        </button>
    );
};

export default ButtonFooter;
